import React, { useState, useEffect } from 'react';
import SideNavbar from "../../components/Doctor/sidenavbar";
import Navbar from "../../components/Doctor/Navbar";
import { Link } from 'react-router-dom';
import '../../css/Doctor/ddashboard.css';
import PreviousAppointments  from './Appointment'; // Import the PreviousAppointments component

export default function DoctorDashboard() {
  const [showBookedAppointments, setShowBookedAppointments] = useState(true);

  return (
    <div className="dashboard-container">
      <Navbar />
      <div className='dashboard-content'>
        <SideNavbar />
        <div className='main-content'>
          <div className="appointments-list-header">
            <h2>This week's appointments</h2>
            <div className="buttons">
              {/* Button to toggle showing booked appointments */}
              <button
                className={showBookedAppointments ? "active" : ""}
                onClick={() => setShowBookedAppointments(true)}
              >
                Booked Appointments
              </button>
              {/* Button to toggle showing previous appointments */}
              <button
                className={!showBookedAppointments ? "active" : ""}
                onClick={() => setShowBookedAppointments(false)}
              >
                Previous Appointments
              </button>
            </div>
          </div>
          {/* Render either booked appointments or previous appointments based on state */}
          {showBookedAppointments ? <BookedAppointments /> : <PreviousAppointments />}
        </div>
      </div>
    </div>
  );
}

function BookedAppointments() {
  const [appointments, setAppointments] = useState([]);

  useEffect(() => {
    // Fetch booked appointments from API
    fetchAppointments();
  }, []);

  const fetchAppointments = () => {
    // Retrieve token from local storage
    const token = localStorage.getItem('token');

    // Make API request to fetch appointments
    fetch('http://localhost:8081/api/v1/doctor/list-appointments', {
      method: 'GET',
      headers: {
        Authorization: `Bearer ${token}`,
      },
    })
      .then((response) => response.json())
      .then((data) => {
        console.log(data);
        // Filter appointments for this week
        const currentDateTime = new Date();
        const startOfWeek = new Date(currentDateTime);
        startOfWeek.setDate(currentDateTime.getDate() - currentDateTime.getDay()); // Start of the current week
        const endOfWeek = new Date(startOfWeek);
        endOfWeek.setDate(startOfWeek.getDate() + 6); // End of the current week

        const thisWeekAppointments = data.filter((appointment) => {
          const appointmentDate = new Date(appointment.slot[0], appointment.slot[1] - 1, appointment.slot[2]);
          return appointmentDate >= startOfWeek && appointmentDate <= endOfWeek;
        });

        // Update state with this week's appointments
        setAppointments(thisWeekAppointments);
      })
      .catch((error) => console.error('Error fetching appointments:', error));
  };

  return (
    <div className="appointments-list col">
      <table className="table" style={{border: 'none'}}>
        <thead>
          <tr style={{border: 'none'}}>
            <th style={{border: 'none'}}>Date</th>
            <th style={{border: 'none'}}>Time</th>
            <th style={{border: 'none'}}>Name of Patient</th>
            <th style={{border: 'none'}}>Actions</th>
          </tr>
        </thead>
        <tbody>
          {appointments.map((appointment, index) => (
            <tr key={index} style={{border: 'none'}}>
              <td style={{border: 'none'}}>{appointment.date}</td>
              <td style={{border: 'none'}}>{appointment.time}</td>
              <td style={{border: 'none'}}>{appointment.patientName}</td>
              <td style={{border: 'none'}}>
                <button className="btn btn-primary btn-sm custom-button" onClick={() => handleOpenModal(appointment)}>
                  View
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}
